import React, { useEffect, useState } from 'react';
import { request } from '../axios_helper';

const ClientAppTable = () => {
    const [apps, setApps] = useState([]);
  
    useEffect(() => {
      // Получите заявки клиента с помощью запроса к серверу
      const fetchApps = async () => {
        try {
          const response = await request('get', '/apps');
          setApps(response.data);
        } catch (error) {
          console.error(error);
        }
      };
  
      fetchApps();
    }, []);
  
    return (
      <div>
        <h2>Заявки клиента</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Адрес</th>
              <th>Телефон</th>
              <th>Фамилия</th>
              <th>Имя</th>
              <th>Отчество</th>
              {/* Добавьте остальные необходимые заголовки */}
            </tr>
          </thead>
          <tbody>
            {apps.map((app) => (
              <tr key={app.id}>
                <td>{app.id}</td>
                <td>{app.address}</td>
                <td>{app.telephone}</td>
                <td>{app.surname}</td>
                <td>{app.firstname}</td>
                <td>{app.patronymic}</td>
                {/* Добавьте остальные необходимые поля */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };
  
  export default ClientAppTable;
